import { getRequest, postRequest, putRequest, postBodyRequest, getNoAuthRequest, postNoAuthRequest } from '@/libs/axios';

export const getParkingOne = (params) => {
    return getRequest('/parking/getOne', params)
}
export const getParkingList = (params) => {
    return getRequest('/parking/getByPage', params)
}
export const getParkingCount = (params) => {
    return getRequest('/parking/count', params)
}
export const addParking = (params) => {
    return postRequest('/parking/insert', params)
}
export const editParking = (params) => {
    return postRequest('/parking/update', params)
}
export const addOrEditParking = (params) => {
    return postRequest('/parking/insertOrUpdate', params)
}
export const deleteParking = (params) => {
    return postRequest('/parking/delByIds', params)
}
